(28, 'Winter Offensive 05', 'Kolejna rozbudowana misja na gildia.org. Tym razem Bartek(N) zaproponował złożone wielostronne uderzenie, w którym na 37 maszyn 15 należało do lotnictwa morskiego, w tym klucz czterech Wombatów. Wymusiło to przydzielenie osobnego kontrolera do nadzorowania operacji startu i powrotu. Widać, że poziom prezentowany przez wszystkie eskadry naprawdę rośnie, bo już drugi raz w tym tygodniu mogliśmy brać udział w solidnie wyglądających operacjach CASE III, a w skutek kapryśnego zachowania DCS, także w pięknej (acz frustrującej) nocnej kolejce do tankowca.<br><br>\r\nOczywiście nie obyło się bez ciekawych zdarzeń, nieuniknionych przy takiej skali przedsięwzięcia. Niektóre systemy zawiodły, niektóre tankowce się nie odzywały, niektórzy piloci o włos uniknęli kolizji. Wszystko to złożyło się na bardzo udany wieczór, którego mocnym akcentem był występ klucza prowadzonego przez Cpt. Poko. Nasza ekipa dostała przydział osłony operacji od płn.-zach., gdzie starła się z czterema przechwytującymi MiG-25 (przenoszącymi R-40) i dwoma MiG-29, strącając 5 wrogich maszyn bez strat własnych. Pretty f*cking ninja, cytując klasyka.<br><br>', '2021-03-19'),
(29, 'Sz%C3%B3sty+%27pe%C5%82ny%27+pilot+w+eskadrze', 'Po+uko%C5%84czeniu+pe%C5%82nego%2C+trwaj%C4%85cego+p%C3%B3%C5%82+roku+szkolenia%2C+1LT+Bonqu+pokaza%C5%82%2C+%C5%BCe+jest+w+stanie+opanowa%C4%87+systemy%2C+techniki+i+procedury%2C+kt%C3%B3rych+znajomo%C5%9B%C4%87+jest+oczekiwana+od+pe%C5%82nowymiarowego+pilota+Marines.+Tym+samym+dzi%C5%9B%2C+z+tradycyjnym+op%C3%B3%C5%BAnieniem+charakterystycznym+dla+wszelkiej+ma%C5%9Bci+administracji%2C+otrzymali%C5%9Bmy+z+departamentu+potwierdzenie+awansu+i+uprawnienie+do+samodzielnych+lot%C3%B3w.%3Cbr%3E%3Cbr%3E%0D%0ASerdecznie+gratulujemy+i+mamy+nadziej%C4%99%2C+%C5%BCe+kolega+dalej+b%C4%99dzie+przyk%C5%82adem+pilno%C5%9Bci+i+roztropno%C5%9Bci%2C+nawet+po+dzisiejszej+popijawie.%3Cbr%3E%3Cbr%3E%0D%0ATym+razem+dzia%C5%82+PR+eskadry%2C+z+przyczyn+absolutnie+niezale%C5%BCnych%2C+nie+by%C5%82+w+stanie+zebra%C4%87+materia%C5%82u+wideo.+Odzyskali%C5%9Bmy+natomiast+jeden%2C+ostatni+kadr+z+drona+sekcji+technicznej+okr%C4%99tu%2C+kt%C3%B3ry+z+jakiego%C5%9B+powodu+znalaz%C5%82+si%C4%99+dok%C5%82adnie+na+drodze+startu+maszyny+507.+Trwa+dochodzenie+maj%C4%85ce+stwierdzi%C4%87%2C+czy+mia%C5%82o+to+jaki%C5%9B+zwi%C4%85zek+z+awari%C4%85%2C+jakiej+dozna%C5%82a+maszyna+na+pocz%C4%85tku+tej+misji.', '2021-04-20'),
