(32, '12 months of wombating!', 'I tak oto niespodziewanie minął okrągły rok od chwili sformowania eskadry w ramach gildia.org. W tym czasie wylataliśmy 1500 osobogodzin, wykonanliśmy okrągłe 240 lotów wszystkich kategorii i zapełniliśmy równo 230 slotów w misjach HRP. Nie było łatwo, ale na pewno było warto.\r\n<br><br>\r\nZobaczymy co przyniesie rok kolejny!\r\n<br><br>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/IlnMpcfjvJ4\" frameborder=\"100\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen; style=\"margin-left: 100px\"></iframe>', '2021-06-12'),
