(14, 'Wikary', 501, 'CO', 'wikary.png', '<p>Założyciel. Wirtualna kariera w DCS rozppoczęta w 100 rocznicę zakończenia I WŚ. Wstępne przeszkolenie z pilotami marynarki w ramach <a href=\"http://vfa313.pl/\" target=\"_blank\">VFA-313 Hellhounds</a>, po przekwalifikowaniu z dowodzenia operacjami lądowymi w ramach grupy <a href=\"https://arma3coop.pl/\" target=\"_blank\">Arma 3 Coop (A3C)</a>. Marshaller <a href=\"https://forum.gildia.org/\" target=\"_blank\">gildia.org</a>.\n</br>\n</br>\nZdecydowanie zbyt dużo czasu spędzam nad DCS...\n</br>\n</br>\nThrustmaster Warthog + <a href=\"https://warthog-extensions-by-sahaj.com/shop/warthog-green-springs/\" target=\"_blank\">Sahaj Green Spring</a> + <a href=\"https://deltasimelectronics.com/products/thumbstick-slew-sensor-adapter\" target=\"_blank\">DeltaSim Thumbstick</a>, MFG Crosswind, Cougar MFD x2, Logitech G Saitek Pro Flight Switch Panel, Oculus Rift S, TrackiR 5. i7-9700K, RTX 2070S.</p>\n</br>\nStatystyki od chwili dołączenia do eskadry:'),
(15, 'Igorczyk', 502, 'Pilot', 'igorczyk.png', 'Współzałożyciel i twórca strony eskadry. Swoją karierę z lotnictwem zaczął z symulatorem FS2002 jeszcze mając 9 lat. w 2013 przesiadł się na FSX, a w 2015 odkrył symulator DCS. Od tamtej pory regularnie uczył się o rzeczach związanych z wojskowym lotnictwem.<br><br>Sprzęt:<br><ul><li>Thrustmaster Hotas X</li><li>Logitech G25 pedals (jako oś do rudder)</li><li>Logitech G25 H-Shifter (jako dodatkowy zestaw przycisków HOTAS)</li><li>FreeTrack 3-point cap</li><li>i7-4790</li><li>GTX 1060 6GB</li><li>24GB DDR3 HyperX 1600MHz</li></ul>\n</br>\nStatystyki od chwili dołączenia do eskadry:'),
(16, 'Kisi', 505, 'XO', 'kisi.png', 'Z wirtualnym lotnictwem związany dopiero od maja 2020 r. Mało umiejętności - duży zapał! \"Na szczęście trafiłem do najlepszej eskadry z możliwych.\"<br><br>\r\nWykorzystywany sprzęt to:\r\nTM HOTAS Warthog (z DeltaSim Slew Upgrade oraz Virpil WarBRD) + TM TFRP, HP Reverb G2 VR, Ryzen 9 5950X, RTX 2080 Ti, 64 GB RAM'),
(17, 'Jettax', 506, 'Pilot', 'jettax.png', 'Lotnictwo interesowało mnie od zawsze, co przełożyło się na ilość sklejonych samolotów stojących na półkach. Wirtualnie latałem i latam od dawna, a grą, która poważnie mnie zaabsorbowała był Lock On. DCS odkryłem w kwietniu 2020 roku i od tego czasu na dobre mnie pochłonął, jeśli chodzi o realne odwzorowanie symulacji. A najlepszy samolot według mnie w DCS-ie? F/A-18 Hornet :).<br><br>\r\nWykorzystywany sprzęt to: AMD Ryzen 5 5600X, Inno3D GeForce RTX 3080Ti 12GB, ASUS PRIME B550-PLUS, HYPER X FURY 32GB 3600 MHz, WinWing Orion F-18 HOTAS, TM TFRPHP, Reverb G2, 3x MFD Cougar, monitor Gigabyte G32QC, FreeTrack.</br></br> Statystyki od chwili dołączenia do eskadry:'),
(18, 'aliant', 503, 'Pilot', 'aliant.png', 'W lotnictwie wirtualnym od 10 lat najpierw jako pilot liniowy, aktualnie stwierdził, że Biuro Podróży USMC zapewnia ciekawsze drogi rozwoju. Po wizycie w biurze rekrutacyjnym został przydzielony do elitarnej VMFA-117 gdzie obecnie zdobywa szlify pilota myśliwskiego.\n<br><br>\nLogitech X-56, Freetrack, I7-7700k, GTX1070\n</br>\nStatystyki od chwili dołączenia do eskadry:'),
(19, 'DarkMnich', 504, 'Pilot', 'darkmnich.png', 'W wirtualnym lotnictwie od około 14 lat, zaczęło się od FS 2004, następnie FS X. W 2013 wstąpiłem do A3C, gdzie przez 5 lat służyłem jako instruktor lotnictwa transportowego, dołączyłem za zaproszeniem do VMFA-117 ponieważ zapragnąłem czegoś więcej niż śmigłowców transportowych. \n<br><br>\nSprzęt: Thrustmaster Hotas X, Laserclip freetrack,  I7-7700k, GTX 1080, 32 GB RAM.\n</br>\nStatystyki od chwili dołączenia do eskadry:'),
(20, 'Bonqu', 507, 'Pilot', 'bonqu.png', 'Od ładnych paru lat w wirtualnym lotnictwie. Początkowo zafascynowany myśliwcami z okresu II Wojny Światowej. Po przesiadce na nowocześniejsze maszyny nie zamierzam wracać do śmigieł. Od  wstąpienia w szeregi VMFA-117 praktycznie latam tylko F/A-18 wciąż ucząc się tej maszyny. Cieszę się, że mogę się szkolić i jednocześnie dobrze bawić pod okiem doświadczonych pilotów z eskadry. \r\n<br><br>\r\nSprzęt:\r\n<br>\r\nTM Hotas Warthog, TM TFRP, TM MFD Cougar Pack, TrackHat, I5-9600K, GTX 1660, 32 GB Ram<br> Statystyki od chwili dołączenia do eskadry:'),
(21, 'Poko', 510, 'Pilot', 'ziplip.jpg', 'Pilot wirtualny z dużym doświadczeniem zdobytym wcześniej w kilku eskadrach: europejskiej VVS504 Red Hammers (LOMAC) i polskich 13WELT (Falcon BMS4), VFA-313 Hellhounds (DCS World). Weteran wielu międzynarodowych kampanii PvP na Falcon-Online i AMVI. W 2020 przeniesiony z USN (VFA-313) do USMC (VMFA-117), gdzie kontynuuje karierę.</br>\r\n</br>\r\nSprzęt: Warthog HOTAS, HP Reverb G1, Saitek Combat Pro Pedals</br>\r\n</br> Statystyki od chwili dołączenia do eskadry:'),
(22, 'Jawor', 596, 'ExWombat', 'jawor.gif', '</br> Statystyki od chwili dołączenia do eskadry:'),
